import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Form from 'react-bootstrap/Form';
import Col from 'react-bootstrap/Col';
import DropdownForm from "./dropdownForm.js";

class StatsForm extends React.Component {
  constructor(props) {
      super(props);
        this.state = {
          dropdownCountry: [{value: "eng", label: "England"},{value: "fra", label: "France"},
          {value: "ger", label: "Germany"},
          {value: "spa", label: "Spain"},
          {value: "ita", label: "Italy"}],
          dropdownLeague: [],
          dropdownFixture: []
      };
    }

  render() {
    return (
      <Container fluid>
        <Row>
          <Form>
            <Col xs={2}>
            </Col>

            <Col xs={2} className="stats-form">
              <DropdownForm
              optionList={this.state.dropdownCountry}/>
            </Col>

            <Col xs={2} className="stats-form">
              <DropdownForm />
            </Col>

            <Col xs={2} className="stats-form">
              <DropdownForm />
            </Col>

            <Col xs={2}>
            </Col>

          </Form>
        </Row>

      </Container>
    )
  }
}
export default StatsForm;
